import React, { Component } from 'react'
import Article from '../Article.js'



export default function({ articles }) {

    var articlesElements = articles.map(article => {

        <li> <Article article={article} /></li>

    })

    return (
        <ul>
		{articlesElements}
	</ul>

    )
}
